import React from 'react';
import MyPic from '../assets/pic.jpg';
import './Home.css'

function Home() {
  return (
    <div className='box'>
      <div className='me-flex'>
        <h2>Who is <span className='name-high'>Ankit</span> ?</h2>
        <h5>Well I'm</h5>
      </div>
      <img className='pic' src={MyPic} alt='My Pic' height={'400px'}/>
    </div>
  )
}

export default Home;
